import React from "react";

export const Input = () => {
  return (
    <div className="d-flex form-floating mb-3" style={{ width: "100%" }}>
      <input
        type="email"
        className="d-flex form-control w-100"
        id="floatingInput"
        placeholder="name@example.com"
        style={{ width: "100%" }}
      />
      <label>Email address</label>
    </div>
  );
};
